import {Navbar} from '../components/Menu/Navbar';
import {Home} from '../components/Home/Home';
import {Certificate} from '../components/Certificate/Certificate';

// hola de estilos
import './App.css'

function App() {

  let valor = 0;

  return (
    <div className='body'>
      <Navbar />
      <div className='section-container'>

        {
          function(valor){
            switch(valor){
              case 0:
                <Home />
                break;
              case 1:
                <Certificate />
                break;
              default:
                <Home />
                break;
            }
          }
        }


      </div>
    </div>
  );

}

export default App;
